class Graph:
    def __init__(self, n):
        self.graph = defaultdict(list)
        self.n = n

    def add_edge(self, u, v):
        self.graph[u].append(v)
        self.graph[v].append(u)

    def dfs_util(self, v, visited, party):
        visited[v] = True
        for i in self.graph[v]:
            if not visited[i]:
                if party[i] == -1:
                    party[i] = 1 - party[v]
                    self.dfs_util(i, visited, party)
                elif party[i] == party[v]:
                    return False
        return True

    def is_possible(self, party):
        visited = [False] * (self.n + 1)
        for i in range(1, self.n + 1):
            if not visited[i]:
                if party[i] == -1:
                    party[i] = 0
                if not self.dfs_util(i, visited, party):
                    return False
        return True

